import React from "react";

const Locations = () => {
  return (
    <>
      <h2>Our locations</h2>
      <ul>
        <li>Giffnock South Glasgow</li>
        <li>Bearsden North Glasgow</li>
        <li>Falkirk</li>
        <li>Stirling</li>
      </ul>
    </>
  );
};
export default Locations;
